import { styled } from "styled-components";
import Navbar from "../components/Navbar";
import { Announcement } from "../components/Announcement";

const Container = styled.div``;

export const ProductList = () => {
  return (
    <Container>
        <Navbar/>
        <Announcement/>
        <Title>Dresses</Title>
        <FilterContainer>
            <Filter>filter1</Filter>
        </FilterContainer>
    </Container>
  )
}
